import React, { useEffect } from "react";
import Header from "./components/Header";
import MovieSlider from "./components/MovieSlider";
import Sidebar from "./components/Sidebar";

function App() {
    return (
        <>
        <Header/>
        <Route exact path="/toprated" component={TopRated} />
        </>
    )
}
export default App;
